package com.mashibing.internal.common.utils.easyExcel.setting;

import java.io.File;
import java.io.FileInputStream;
import java.io.IOException;
import java.util.Base64;

import lombok.extern.slf4j.Slf4j;

/**
 * @author: kavanLi-R7000
 * @create: 2024-07-05 15:43
 * To change this template use File | Settings | File and Code Templates.
 */
@Slf4j
public class SealBase64Data {


    /**
     * 先用tinyImage压缩图片
     * @param args
     */
    public static void main(String[] args) {
        try {
            File file = new File("C://tlseal.png");
            String base64String = encodeImageToBase64(file);
            log.info("Base64 String: " + base64String);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

    public static String encodeImageToBase64(File file) throws IOException {
        FileInputStream imageInFile = new FileInputStream(file);
        byte[] imageData = new byte[(int) file.length()];
        imageInFile.read(imageData);
        imageInFile.close();
        return Base64.getEncoder().encodeToString(imageData);
    }

    public static String SEAL_BASE64_STRING = "";
}
